import React from "react";
import { Link } from "react-router-dom";
import Header from '../Header/Header';
import "./Profile.css";
import Logout from "../Logout/Logout";

export const Profile = () => {
  return (
   <div>
              <Header />
          <div className="profile-container">
      <h1 className="profile-title animate__animated animate__fadeInDown">Имя Человека</h1>
      <div className="profile-image-container animate__animated animate__fadeIn">
        <img 
          src="images/ProfilePicture.jpg" 
          className="profile-image" 
          width={250} 
          height={250} 
          alt="ProfilePicture" 
          loading="lazy"
        />
      </div>
      <div className="profile-description animate__animated animate__fadeInUp">
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
      </div>
          <Logout/>
    </div>
   </div>
  );
};

export default Profile;
